CREATE TABLE publicacoes
(
  pub_cod serial NOT NULL,
  pub_data date,
  pub_dataalteracao date,
  pub_legenda character varying(20),
  pub_titulo character varying(100),
  pub_sumario text,
  pub_conteudo text,
  pub_autor character varying(50),
  pub_fonte character varying(250),
  pub_img_nome character varying(200),
  pub_img_descricao character varying(150),
  pub_img_mime character varying(20),
  pub_visualizacao integer DEFAULT 0,
  pub_status character(1) DEFAULT 'I'::character varying,
  CONSTRAINT publicacoes_pkey PRIMARY KEY (pub_cod)
);

CREATE TABLE website
(
  web_cod serial NOT NULL,
  web_titulo character varying(100) NOT NULL,
  web_descricao text,
  web_slogan character varying(50),
  web_proprietario character varying(50),
  web_endereco character varying(100),
  web_numero character varying(10),
  web_bairro character varying(40),
  web_cep character varying(10),
  web_estado character(2),
  web_cidade character varying(40),
  web_telefone character varying(15),
  web_email character varying(100),
  web_site character varying(50),
  web_orkut character varying(250),
  web_twitter character varying(250),
  web_facebook character varying(250),
  web_flickr character varying(250),
  web_linkedin character varying(250),
  web_myspace character varying(250),
  web_vimeo character varying(250),
  web_youtube character varying(250),
  web_blog character varying(250),
  web_localizacao text,
  web_messenger character varying(100),
  web_skype character varying(50),
  web_img_padrao bytea,
  web_img_mime character varying(30),
  web_img_nome character varying(250) DEFAULT 'sem_imagem.gif'::character varying,
  CONSTRAINT pk_website PRIMARY KEY (web_cod)
);

CREATE TABLE paginas
(
  pag_cod serial NOT NULL,
  pag_conteudo text,
  pag_extra text,
  pag_legenda character varying(100),
  pag_posicao character(1),
  pag_titulo character varying(25),
  CONSTRAINT pk_paginas PRIMARY KEY (pag_cod)
);

CREATE TABLE links
(
  lin_cod serial NOT NULL,
  lin_nome character varying(40),
  lin_url character varying(250),
  CONSTRAINT pk_links PRIMARY KEY (lin_cod)
);

CREATE TABLE usuarios
(
  usu_cod serial NOT NULL,
  usu_nome character varying(50),
  usu_email character varying(100),
  usu_senha character varying(100),
  usu_endereco character varying(100),
  usu_numero character varying(10),
  usu_cidade character varying(40),
  usu_cep character varying(10),
  usu_estado character(2),
  usu_perfil character(1),
  CONSTRAINT pk_usuarios PRIMARY KEY (usu_cod)
);

