CREATE TABLE cidades
(
  cid_cod bigint NOT NULL,
  cid_nome character varying(40),
  cid_nome_obs character varying(55),
  cid_uf character(2),
  CONSTRAINT cidades_pkey PRIMARY KEY (cid_cod)
);

